import React, {Component} from 'react';

import './Poem.css';


export class Poem extends Component {
  render() {
    return (
      <div className="row">
        <div className="Poem col-6">
          {this.props.children}
        </div>
      </div>
    );
  }
}


export class Stanza extends Component {
  render() {
    return (
      <div className="Stanza">
        {this.props.children}
      </div>
    );
  }
}
